import React from 'react';
import './homelogo.css';

const defaultProfPic = require('./homelogo.png');

const HomeLogo = ({profpic}) =>
    <div id="whole">
        <div id="homeimage"><img id="homelogoimg" src={profpic} /></div>
    </div>;

ResultImage.defaultProps = {
    profpic:defaultProfPic,
}

export default HomeLogo;
